import React from 'react';

const styles = {
  lainlines: {width:'30%',
              height: '30%'}
};

let LainImg = () => (
  <img src="../images/lainlines.gif" style={styles.lainlines}/>
);

const buttonHandler = (event) => {
  console.log(LainImg.src());
  LainImg.src === '../images/lainlines.gif' && (LainImg.src = '../images/bluelines.gif');
};

let LainButton = () => (
  <button onClick={buttonHandler}>Click to switch image</button>
);

const General17 = () => (
  <div>
    <LainButton />
    <LainImg />
  </div>
);

export default General17;
